import { useEffect, useState } from "react";
import { useRef } from "react";

function App() {
  const [data, setData] = useState(null);

  useEffect(()=>{
    setTimeout(() => {
      fetch('https://api.example.com/data')
      .then(response=>response.json())
      .then(jsonData=>{
      setData(jsonData);
      console.log(jsonData);
    })
    }, 30000);

  },[])

  return <div>
    {data}
  </div>
}

export default App;
